/*
=========================================================
* Material Kit 2 React - v2.0.0
=========================================================

* Product Page: https://www.creative-tim.com/product/material-kit-react
* Copyright 2021 Creative Tim (https://www.creative-tim.com)

Coded by www.creative-tim.com

 =========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.
*/

// @mui material components
import Container from "@mui/material/Container";
import Grid from "@mui/material/Grid";
import { Divider } from "@mui/material";
import Card from "@mui/material/Card";

// Material Kit 2 React components
import MKBox from "components/MKBox";
import MKTypography from "components/MKTypography";
import MKSocialButton from "components/MKSocialButton";

// Material Kit 2 React examples
import DefaultNavbar from "examples/Navbars/DefaultNavbar";
import DefaultFooter from "examples/Footers/DefaultFooter";

// Presentation page sections

import Information from "pages/Presentation/sections/Information";
import Download from "pages/Presentation/sections/Download";

// Presentation page components
import BuiltByDevelopers from "pages/Presentation/components/BuiltByDevelopers";

// Routes
import routes from "routes";
import footerRoutes from "footer.routes";

// Images
import bgImage from "assets/images/bg1.jpg";
import imagelogo from "assets/images/logos/gray-logos/logols4.png";
import Carrusel from "examples/Cards/Slider/Slider";

function Presentation() {
  const customStyles = {
    textShadow: "1px 1px 3px #f0f0f095", // Personaliza estos valores según tus preferencias
    color: "f0f0f0",
  };
  const blueColor = '#70C7FF'; // Color azul

  return (
    <>
      <DefaultNavbar
        routes={routes}
        action={{
          type: "external",
          route: "http://localhost:3000/pages/landing-pages/contact-us",
          label: "CONTACTANOS",
          color: "info",
        }}
        blue
        light
        sticky
      />
      <MKBox
        minHeight="75vh"
        opacity={0.8}
        width="100%"
        sx={{
          backgroundImage: `url(${bgImage})`,
          backgroundSize: "cover",
          backgroundPosition: "top",
          backgroundAttachment: "fixed", // Fondo estático
          display: "grid",
          placeItems: "center"
        }}
      >
        <Container>
          <Grid container item xs={12} lg={4} justifyContent="center" mx="auto">
            <MKTypography
              variant="h1"
              color="white"
              style={customStyles}
              backgroundColor="#ffffff99"
              textAlign="center"
              boxShadow="3px 3px 1px #f0f0f095"
              borderRadius={12}
              padding={0}
              pr={0}
              mt={-6}
              mb={1}
              zIndex={5}
              sx={({ breakpoints, typography: { size } }) => ({
                [breakpoints.down("md")]: {
                  fontSize: size["3xl"],
                },
              })}
            >
              <img src={imagelogo} alt="Servicio Médico Empresarial L.S." width="100%" />
            </MKTypography>{" "}
          </Grid>{" "}
        </Container>{" "}
      </MKBox>{" "}
      <Card
        sx={{
          p: 2,
          mx: {
            xs: 1,
            lg: 3,
            md: 2,
          },
          mt: -10,
          mb: 4,
          backgroundColor: ({ palette: { white }, functions: { rgba } }) => rgba(white.main, 0.8),
          backdropFilter: "saturate(200%) blur(30px)",
          boxShadow: ({ boxShadows: { xxl } }) => xxl,
        }}
      >
        <Container>
          <MKBox xs={12} lg={12}>
            <Grid
              item
              xs={12}
              md={0}
              sx={{
                mb: 10,
                mt: 4,
              }}
            >
              <MKTypography
                variant="h1"
                color="dark"
                sx={{
                  textAlign: "center",
                  mb: 3,
                }}
              >
                Servicio Médico Empresarial L.S.{" "}
              </MKTypography>{" "}
              <MKTypography
                variant="h5"
                color="dark"
                opacity={0.8}
                sx={{
                  textAlign: "center",
                }}
              >
                Servicios médicos especializados en soporte empresarial.{" "}
              </MKTypography>{" "}
            </Grid>{" "}
          </MKBox>{" "}
        </Container>
        <Carrusel />

        <Divider style={{ backgroundColor: blueColor, height: 5, marginTop: 200 }} />
        <Grid container>
          <Grid
            item
            xs={12}
            md={0}
            sx={{
              mb: 4,
              mt: 6,
            }}
          >
            <MKTypography
              variant="h2"
              color="dark"
              sx={{
                textAlign: "center",
                mb: 3,
              }}
            >
              Asesoría Médica Empresarial{" "}
            </MKTypography>{" "}
            <MKTypography
              variant="body1"
              color="dark"
              opacity={0.8}
              sx={{
                textAlign: "center",
              }}
            >
              Con más de 10 años de experiencia, ¡Estamos listos para ayudarte!
            </MKTypography>{" "}
          </Grid>{" "}
        </Grid>{" "}
        <Information />
        <Container
          sx={{
            mt: 6,
          }}
        >
          <BuiltByDevelopers />
        </Container>{" "}
        <Download />{" "}
        <MKBox pt={18} pb={6}>
          <Container>
            <Grid container spacing={3}>
              <Grid
                item
                xs={12}
                lg={5}
                ml="auto"
                sx={{
                  textAlign: {
                    xs: "center",
                    lg: "left",
                  },
                }}
              >
                <MKTypography variant="h4" fontWeight="bold" mb={0.5}>
                  Gracias por tu preferencia!
                </MKTypography>{" "}
                <MKTypography variant="body1" color="text">
                  Soluciones médicas a tú medida{" "}
                </MKTypography>{" "}
              </Grid>{" "}
              <Grid
                item
                xs={12}
                lg={5}
                my={{
                  xs: 5,
                  lg: "auto",
                }}
                mr={{
                  xs: 0,
                  lg: "auto",
                }}
                sx={{
                  textAlign: {
                    xs: "center",
                    lg: "right",
                  },
                }}
              >
                <MKSocialButton
                  component="a"
                  href="https://www.smels.com.mx"
                  target="_blank"
                  color="twitter"
                  sx={{
                    mr: 1,
                  }}
                >
                  <i className="fab fa-twitter" />& nbsp; Tweet{" "}
                </MKSocialButton>{" "}
                <MKSocialButton
                  component="a"
                  href="https://www.facebook.com/people/Servicio-Medico-Empresarial-LS/100064278240012/?mibextid=ZbWKwL"
                  target="_blank"
                  color="facebook"
                  sx={{
                    mr: 1,
                  }}
                >
                  <i className="fab fa-facebook" />& nbsp; Share{" "}
                </MKSocialButton>{" "}
                <MKSocialButton
                  component="a"
                  href="https://www.smels.com.mx"
                  target="_blank"
                  color="pinterest"
                >
                  <i className="fab fa-pinterest" />& nbsp; Pin it{" "}
                </MKSocialButton>{" "}
              </Grid>{" "}
            </Grid>{" "}
          </Container>{" "}
        </MKBox>{" "}
      </Card>{" "}
      <MKBox pt={6} px={1} mt={6}>
        <DefaultFooter content={footerRoutes} />{" "}
      </MKBox>{" "}
    </>
  );
}

export default Presentation;
